import './App.css'
import React, { PureComponent } from 'react'
import CryptoBanner from './banner'

class App extends PureComponent {

  constructor (props) {
    super(props)
    this.state = {
      tokensLoaded: false
    }
  }

  renderForm () {
    return (
      <div className={'form'}>
        <span>Form</span>
      </div>
    )
  }

  render () {
    const { tokensLoaded } = this.state

    return (
      <div className={'App'}>
        <div class={'header'}>
          <CryptoBanner />
          <h1>ERC-20 Name Service Registrar</h1>
        </div>
        {
          tokensLoaded
          ? this.renderForm()
          : null
        }
      </div>
    )   
  }
}

export default App
